(30, 3, 3, 0, 25, 0, 46, 0, '2011-08-08 16:28:52', 'Ok the files and fodlers have been set to sync from home. Minor changes to the network card were required for this.\r\n\r\nSyncing is now carried out using windows explorer along the top in the menu bar you now have the buttons "work online" and "work offline" to control when you are online or offline.\r\n\r\nThere is also a drop down button "sync" that will give you the option to selectivly sync any folders or files you are working on.  If you are working offline and your work has only been in 1 or 2 folders,clickt into the foler so that you can see its contents and click on "sync->sync offline files in this folder" and it will sync the files (update) the server copyfor that folder. PLease note if you sync on the entire P drive it will take 15-20min to finish a complete sync. Easy to only sync those folders you have activly worked on.\r\n\r\nPlease note when you are in the office and plugged into the network a "complete" sync of P:\\ and documents will be carried out automattically.', 0, 1),
