(53, 4, 2, 0, 42, 0, 5, 0, '2011-09-19 14:03:54', 'As part of Madeleines request to see Andrews faulty PC on 9/9/2011.\r\nShe asked me to look at this machine while there as they moved it and not casnnot connect it to the ISF network or the Internet, \r\nI found that there were in fact  2 NICs in the PC. One which was was part of the motherboard  (but disconnected by the OS), had the network cable inserted into it.\r\nTher was a "Stand Alone" NIC which was used by the OS.\r\nrelocating the cable resolved the issue. \r\nMadeleine was advised of the resolution of the issue.', 0, 1),
