(208, 3, 2, 0, 84, 1, 0, 0, '2012-01-05 13:49:54', 'Smart Fill needed the USB adapter driver sfotware to be installed. I went onsite to complete this fix, after downloading the x64 drivers and x64 java software. This has been stored in the support Directory.', 0, 1),
(209, 4, 2, 0, 216, 1, 0, 0, '2012-01-05 14:45:06', 'Tickect considered as closed after investigation.\r\nDfsvc.exe can be a legit file as part of .NET V4, Client and since  the client side was installed only on 12th December.\r\nIt exists in location C:\\Windows\\Microsoft.NET\\Framework64\\v4.0.30319.\r\n\r\nIt can also be part of a virus/worm, but if that’s the case, why has it not been detected with a modern AV with 2012 dated virus definitions?\r\nTo quote from google:   \r\n” I made a scan with the bitdefender scan on my network, and it found the virus cryp-xed-21 on an old copy of dfsvc.exe that was on one of the two pc that had the problem.”\r\n\r\nI am now reasonably satisfied that this executable is likely not a bad process, provided that the only 2 file versions of dfsvc.exe exist.\r\nA 32 and 64 bit version of this file is on this PC in what seems the correct location, and they seem to both seem to be Microsoft digitally signed.\r\n\r\n\r\n\r\n', 0, 1),
(210, 3, 2, 0, 222, 0, 40, 0, '2012-01-06 09:57:16', 'Looks like and additional server start/stop was required. I have added this into the automated script', 0, 1),
(211, 3, 2, 0, 224, 0, 20, 0, '2012-01-06 15:51:44', 'Robin not logged as a local admin on the machine, I needed to log onto machine as administrator and install the software. Install package stored on the support$ directory.', 0, 1),
