(368, 4, 2, 0, 399, 0, 30, 0, '2012-02-13 15:13:13', 'The issue for Molly’s Outlook has been rectified. \r\n\r\nThe CRM component for Outlook was disabled by the user. The reason this can happen is when the computer/Outlook is opened the computer is sending and received a high amount of data (usually logging in the user). If the users is too quick for the PC that they are on Outlook can become unresponsive. If this happens a message window can be thrown up on the screen asking the user to disable the CRM add-in, if the user clicks yes then the CRM add-in will moved to the disabled items folder in Outlook.\r\nLiased with Mark and resolved.\r\nSee as below\r\n\r\nTo enable the CRM add-in simply do the following:\r\n\r\n1.	In Outlook click help form the main menu\r\n2.	Click on disabled items\r\n3.	Select CRM from the list and click enable\r\n\r\nThis is not a regular occurrence but please keep me informed if it happens again as there are patches available to rectify this problem.\r\n', 0, 1),
