(441, 4, 2, 0, 486, 2, 0, 0, '2012-02-28 12:46:43', '1/.	Pete had OnlineAVL1 rather than OnlineAVL2 installed on his LT build. Out of date and would never work.\r\n2/. 	Replacing OnlineAVL1 with OnlineAVL2 as per the text file did not resolve things. Still had password failure.\r\n3/.	Madeleine confirmed passwords and their working status. No maximum number of concurrent connections.\r\n	Took a while to find a troubleshooting PDF that was not password protected by NavManWireless (Yeah I''m serious).\r\n	From the documentation, only lead was that it could be some sort of OS based outgoing port rule required for contacting the NavMan site as it can generate password 	failure if this occurs.\r\n	Tested using rules and proved not to be.\r\n4/. 	Realised from txt file in client info there could an AU site for downloading OnlineAVL2 as well as a US site. There was.\r\n	AU uses Version:	11.2.1111.1110\r\n	US uses Version:	11.2.1111.1170\r\n	So US version client is not compatible with AU version servers.\r\n5/.	AU version works fine.\r\n6/.	Irwin passwords for AVL2 work fine.\r\n	Second Password currently used is:\r\n	U:	madeleine.pinnuck\r\n	P:	cattle\r\n', 0, 1),
(442, 4, 2, 0, 466, 1, 45, 0, '2012-02-29 13:47:04', 'Testing conducted on "Payroll" Machine.\r\n\r\nAny attempt to update/uninstall generated errors under Domain Administrator account.\r\nInsufficient privlieges at file and folder levels for both the program application and the system 32 folder.\r\n\r\nFor Folder %systemdrive%\\Program Files\\irwrinordering2":\r\n\r\nGenerated New Security permissions as follows \r\n"Machine Name"\\Administrators\r\nISF\\Administrator\r\nSYSTEM\r\nISF\\STAFF\r\nInheretance was switched off for folder and new settings were applied to child objects.\r\n\r\nFor %SystemDrive%\\windows\\system32\r\n"Machine Name"\\Users\r\n"Machine Name"\\Power Users\r\nSYSTEM\r\nwere preserved.\r\nSpecific user acccount (in this case Molly) was removed.\r\n\r\nGenerated New Security permissions as follows for Folder%SystemDrive%\\windows\\system32.\r\n"Machine Name"\\Administrators\r\nISF\\Administrator\r\nSYSTEM\r\nISF\\STAFF\r\n\r\nUninstall successful.\r\n\r\nFresh install unsuccessful.\r\n\r\nForgot to switch off inheretance which temporarily created a secondary issue with some services.\r\nRegenerated New Security permissions again as previosly stated.\r\nInheretance was switched off for folder and new settings were applied to child objects.\r\nSecondary issue disappeared.\r\n\r\nInstall successful.\r\n\r\nUpdate process fails mentioning specific files in SYSTEM32 folder.\r\nFound some security permissions for said files in SYSTEM32 folder not updated by application of security permission changes to child objects.\r\nThese files were left as part of uninstall and could not be overwritten in re install\r\nOnly permissions on these 2 files were ISF\\Molly and SYSTEM\r\nFilenames not updated include: "myodbc5.dll" and "myodbc5s.dll"\r\n\r\nTook Ownership of files and applied security permissions\r\n\r\nUpdate successful.\r\n\r\nRequest by Shamus to create Script for this using CACLS', 0, 1),
