(537, 4, 9, 0, 584, 0, 15, 0, '2012-03-24 13:16:57', 'Issue found to be due to Microsoft secuity update.\r\nResolution as per url: http://support.labtechsoftware.com/component/k2/item/904.html\r\n1.Within the LabTech server, go to c:\\inetpub\\wwwroot\\labtech.\r\n2.Open the web.config file.\r\n3.Add the following line to the appSettings area~11 lines from top of file (This is to be the 12th line).\r\n        <add key="aspnet:MaxHttpCollectionKeys" value="10000" />\r\n\r\n \r\n4.Save the file.\r\n5.Restart IIS.\r\n', 0, 1),
