(2953, 4, 2, 0, 3118, 0, 30, 0, '2012-08-31 12:24:46', 'Harry from Telstra contacted me today (88314310).\r\nAdvised  Fax number for site is for an ADSL 2 (not 2+) connection.but he could be wrong and it would be better to get local information.\r\nExplained he was messenger and said we would need to talk with a contractor that represented Telstra locally for the Lang Lang  site.\r\nGave Contact number  as 1800 773 776.\r\nStressed that we should use specific langauge and state that voice lines are at the address and that we require data line solution. He also stated that  we should be specific about speed, capacity, and medium  needs. (EG fibre/wire, speed, synchronous 100-200GB per month).\r\nWe would then be offered various availibility and ETA''s IE 1 month to 2 years plus, If only cable wire or fibe is available ECT.\r\n\r\nAs a seperate note from me, I have assumed that the address where the factory is being built is exactly the same site as where the current voice lines are.\r\n', 0, 1),
