(2979, 4, 2, 0, 3118, 0, 30, 0, '2012-09-14 10:14:32', 'iiNET have responded a with a quotation that was not in the realms of what was originally requested by us.\r\nRather than assume what was quoted below as the best iiNET has available I contacted Paige only to find out that Paige has taken leave and had to speak to another.\r\nThe other staff member tended to re-iterate that this was the besta available, and I reminded them that a bonded DSL solution at 20% of the price provided ~80% of the upstream performance and 800% of the downstream performance (I noted current connection speed is ~8MBps which is ~400%) of what was offered.\r\nI noted that as far requirements suggested to Shamus this offer falls below the 4M/4M minimum specification required for this basis.\r\nI am awaiting further updates from iiNET in writing.\r\n\r\n\r\nHello Charles,\r\n \r\nI apologise for the delay in getting back to you. I have qualified your site for SHDSL availability, due to the area there is limited services available however we should be able to provide a 2Mbps X.163 (Leased Line) service. Please find below pricing for this service.\r\n2Mbps Leased Line (1:1) Service with 500GGBytes included monthly download\r\nEstablishment: $0\r\nMonthly: $3,185 \r\nExcess: $0.01 \r\nGST-incl and based on minimum 24-month term \r\nPricing and Service are subject to infrastructure availability and capacity check at order stage\r\nService is presented as G.703 (RJ-48). We will need a media converter for G.703 to Ethernet  which we can supply\r\nPlease let me know if this pricing is within your budget, alternatively if you have any further queries.\r\nRegards,\r\n\r\nPaige Downes\r\nCustomer Service Representative\r\niiNet Business\r\n\r\n \r\n\r\niinet limited, locked bag 16, cloisters square WA 6850\r\nph: 13 24 49 fax: 1300 785 632\r\nemail: bizsupport@iinet.net.au\r\nweb: www.iinet.net.au/business\r\n\r\nMake big savings on your business call costs with SIP Trunking. Find out more at www.iinet.net.au/business/sip-trunking\r\n', 0, 1),
