(2981, 4, 2, 0, 3118, 0, 30, 0, '2012-09-14 13:39:13', 'PRE-PROVISIONING\r\n\r\nSpoke to Angela at ServiceStream (1800 773 776)  in regards to Pre Povisioning. \r\nIt seems ISP''s require Pre-Provisioning in situations like Lang Lang.\r\n\r\nConfirmed there is Fibre running ~550m from site sometimes through private property.\r\nShe feels that we would not be given access to the fibre under any situation. Final Word from Telstra would be required.\r\nEthenet would be available.\r\nData suggests a P20 pipe for telephone lines is present, but there could be anywhere between 2-10 pairs going to the site.\r\nTelstra would need to consult their internal T.O.M.S. database to be sure.\r\nIrwins would also need to confirm thier specification for this site and how many lines they require for voice, FAX ECT.\r\nPre-Provisioning suggest we will be required to install a P50 anyway and Trenching at Irwins cost would be required.\r\n\r\nOnce the Pre Provisioner Surveyor comes out and takes Notes. The Pre Provisioner will build a design to suit the lines to the new site of the MDF.\r\nThis requires written approval from Telstra. Once this is approved by Telstra, A construct Pack will be provided by Telstra at Telstras''s expense.\r\nThis pack shall be allocated to a local contractor and liase with the customer until satisfactory completion.\r\nTelstra will then be notified of completion and any extra works (Line connection, ECT).\r\n\r\nAlthough Turnover time is suggested as 6-8 weeks, It could take 2-3 months.\r\n\r\nAngela  also said "Alternatively Telstra Commercial Works (1800 810 443) could help, but they will be more expensive"\r\n', 0, 1),
