(3003, 4, 2, 0, 3118, 1, 15, 0, '2012-10-01 10:58:05', 'Summary  and Further correspondence withTelstra discussing Ethernet and Fibre options.\r\nTelstra do not offer Leased Line SHDSL service like Exetel.\r\nTelstra has a negative where they charge data upon aggregate.\r\nI am still waiting for confirmation if in fact fibre while doubtful  is even possible.\r\nCould even get a quote for possible pricing of Fibre installation over 550+metre run this week which is delayed by Michael having a death/Funeral in the family.\r\n=================================================\r\n\r\nHello Charles,\r\nSorry for the misunderstanding, yes the worst case scenario would be $5708 as the excess is on top of the monthly service rental. As for the fibre optic, I have spoken to someone from that department and he has to check if it can be done. Once I know I will be able o give you a better quote as I don’t want to misinform you at all. I will be in touch soon as I will be speaking to him again today.\r\nKind regards,\r\n\r\n\r\n Michael Garrett – Business Development Manager\r\nTelstra Business Centre Casey & Cardinia\r\nE: michaelg@tbccaseycardinia.com.au\r\nM: 0432 265 029\r\nP: 03 5945 5945\r\nF: 03 9277 7710\r\n\r\nFrom: Charles Foletta [mailto:charles.foletta@sapient-tech.com.au] \r\nSent: Tuesday, 25 September 2012 9:57 AM\r\nTo: Michael Garrett\r\nSubject: RE: (LJ) milburn lake pty ltd 284924\r\n\r\nHello Michael.\r\n\r\nThanks for your response.\r\n\r\nI’m was not quite clear on what a customer can pay in a month for a 4M/4M.\r\nWhen you say “For 4/4 the excess data cap is $4070” we I would have to assume we are talking ($4070 excess + $1638 monthly fee for the included 100GB Total allowance) =$5708 total monthly fee for 4M/4M in a worst case scenario. The unlimited plan was always clear in explanation.\r\n\r\nI look forward to hearing more on fibre optic. There is far more scope for potential expansion if they later require it.\r\nIt will be ultimately up to the client to decide what they deem as a necessary investment. \r\n\r\n\r\nCharles. M. Foletta.\r\nSapient Technology Solutions\r\n\r\n(E):  charles.foletta@sapient-tech.com.au\r\n(W): http://www.sapient-tech.com.au/\r\n(B):  61-3-9484-0114   (M):  0413-211-537\r\n\r\nFrom: Michael Garrett [mailto:michaelg@tbccaseycardinia.com.au] \r\nSent: Monday, 24 September 2012 2:08 PM\r\nTo: Charles Foletta\r\nSubject: RE: (LJ) milburn lake pty ltd 284924\r\n\r\nHello Charles,\r\nI have spoken with the Telstra business tech team in regards to a few of your questions.\r\nIn regards to fibre optic, you can have them look at running a line to the address but it can be quite expensive if they are running a new line for 550 metres just to your site. We would need to speak to a completely different department in regards to getting someone to look at this. I have attempted to contact them to get a small idea on the costs and I am just waiting for them to reply. As for the leased line option, that isn’t available so it isn’t an option. As for the data limit, it is the sum of the upload and the downloads together that make up the total usage for the month. Excess Usage Charges: 8c/ MB for each MB that exceeds the Included Data Allowance that is allowed each month for a customer''s selected plan. Excess usage charges are not applicable against Unlimited usage plans. For 4/4 the excess data cap is $4070. The last time we organized for fibre to be ran into an address it cost $7000 just for the line in from the pit outside the address.  \r\nOnce I hear back from the complex data team I will let you know ASAP.\r\nKind regards,\r\n\r\n\r\n\r\n Michael Garrett – Business Development Manager\r\nTelstra Business Centre Casey & Cardinia\r\nE: michaelg@tbccaseycardinia.com.au\r\nM: 0432 265 029\r\nP: 03 5945 5945\r\nF: 03 9277 7710\r\n\r\nFrom: Charles Foletta [mailto:charles.foletta@sapient-tech.com.au] \r\nSent: Friday, 21 September 2012 5:19 PM\r\nTo: Michael Garrett\r\nSubject: RE: (LJ) milburn lake pty ltd 284924\r\n\r\nHello Michael.\r\n\r\nNo inconvenience at all.\r\nIt was explained to me you were on the road a lot in the last few days.\r\nSome questions are just pricing and plan queries as it was unclear on the website (maybe I just missed it)\r\n\r\nOther ISP’s charge differently for each plan.\r\nFor example iiNET set their domestic DSL data limits as aggregate, or the sum total of upstream and downstream data usage.\r\nBy comparison iiNET set their business DSL data limits as download only (IE unlimited upload)\r\n\r\nHave a great weekend.\r\nRegards\r\n\r\nCharles. M. Foletta.\r\nSapient Technology Solutions\r\n\r\n(E):  charles.foletta@sapient-tech.com.au\r\n(W): http://www.sapient-tech.com.au/\r\n(B):  61-3-9484-0114   (M):  0413-211-537\r\n\r\nFrom: Michael Garrett [mailto:michaelg@tbccaseycardinia.com.au] \r\nSent: Friday, 21 September 2012 5:10 PM\r\nTo: Charles Foletta\r\nSubject: RE: (LJ) milburn lake pty ltd 284924\r\n\r\nHello Charles,  \r\nI have sent off an email to the tech team in regards to a few of your questions and I am waiting on a response.\r\nI will forward you the response as soon as I have received it. Sorry for any inconvenience.\r\nKind regards,\r\n\r\n\r\n Michael Garrett – Business Development Mana', 0, 1),
(3004, 4, 2, 0, 3118, 0, 45, 0, '2012-10-01 11:22:35', 'Extra follow up with Exetel.\r\nThey confirm they can do up to a 10M/10M solution although not tested are very confident they can acheive due to a leased line being used.\r\nIMHO unless Irwins are able to get, and are prepared to pay for fibre installation. \r\nThe Exetel offer is in writing and the best value offer so far and has a known fixed monthly cost.\r\nTelstra has Expensive Excess fees at $80/GB. and maxes @151GB in a 4M/4M plan costing $1638 plus $4070 excess.\r\nTelstra unlimited at 4M/4M is $4060\r\nTelsta wont do 10M/10M\r\n\r\nExetel is unlimited data usage\r\n36 Months \r\n1 x TL04 (Protected), Setup = $7,150.00, Monthly = $3,050.00, Yearly = $36,600.00 \r\n1 x TL04, (Unprotected) Setup = $7,150.00, Monthly = $2,450.00, Yearly = $29,400.00 \r\n1 x TL10, (Protected) Setup = $7,150.00, Monthly = $5,350.00, Yearly = $64,200.00 \r\n1 x TL10, (Unprotected) Setup = $7,150.00, Monthly = $4,300.00, Yearly = $51,600.00\r\n======================\r\nHi Shari.\r\n\r\nThanks for responding, and please understand there is no further need to respond here.\r\nIt was more an observation in terms of meeting the space between these ISP offers and the client desires. \r\nI understand there are set responses and I have no issue with it. Telstra have done similar things here.\r\nAt the same time, we have a client that does not want to speculate when they feel they need standards met.\r\n\r\n1/.          That may be with Exetel, but Telstra has an indifferent relationship with us. \r\nPlease also note that it was Telstra retail questioning that anyone would be allowed to place a leased line service here, not us.\r\nAlso please note that we have told you about Telstra but have not advised Telstra of Exetels bid.\r\n2/.          I am not entirely sure what you mean by this response.\r\nI guess all I can take out of this is that the available line speed will not be confirmed until a site Survey is completed and that is only done once an order is received.\r\nAny prospect of buying first on speculation then coming up short afterwards in a survey is not a favourable outcome for any client.\r\nI will always be concerned in proposing to a customer to buy a service/product that  may not be delivered upon at a later stage.\r\n3/.          While I too know there is really no difference, the fact remains that Telstra wholesale chose not to help AAPT Ethernet here in Preston beyond Voice grade support on Telstra owned lines. Yet Telstra wholesale will back Telstra retail Ethernet in Lang Lang to data grade. Not a level playing field IMHO.\r\n4/.          I’m sure it is the most reliable services available today. It is mainly the case of us wanting to advise our clients in terms of what they will get, not what might be possible, then having to lower their expectations at a later stage. \r\nWe just prefer our clients to make a decision with confidence rather than trepidation as it makes better relationships and for that matter, better business.\r\n\r\nI guess we will need to advise that the service is subject to site survey, and testing.\r\nIronically the Telstra Ethernet offer is in a somewhat similar situation in that their offer is guaranteed to work, but is subject to the copper availability at the time of the install. Hope you enjoy the humour in that.\r\n\r\nRegards, and have a great weekend.\r\n\r\nCharles. M. Foletta.\r\nSapient Technology Solutions\r\n\r\n(E):  charles.foletta@sapient-tech.com.au\r\n(W): http://www.sapient-tech.com.au/\r\n(B):  61-3-9484-0114   (M):  0413-211-537\r\n\r\nFrom: Shari Westlake [mailto:Shariw@exetel.com.au] \r\nSent: Friday, 21 September 2012 2:53 PM\r\nTo: Charles Foletta\r\nSubject: RE: (LJ) milburn lake pty ltd 284924\r\n\r\nHi Charles,\r\n\r\nThank you again for your email, Please find our below answers to your points;\r\n1.	Exetel has a significant relationship directly with Telstra Wholesale, and we can provide a leased line service to any location in Australia.\r\n2.	This speed is subject to an order being placed, and a physical survey of the sites, however leased line has great range over other copper products, so this should not be an issue.\r\n3.	There is no difference in lines provided by Telstra Retail, to Telstra Wholesale, it uses almost all the same infrastructure. \r\n4.	Leased line services are some of the most reliable services available today, and you will not have a repeat of the issues that plagued your connection. \r\n\r\nThanks and please let me know if you require any further information.\r\n\r\nShari \r\n\r\nFrom: Charles Foletta [mailto:charles.foletta@sapient-tech.com.au] \r\nSent: Friday, 21 September 2012 11:10 AM\r\nTo: Shariw@exetel.com.au\r\nSubject: FW: (LJ) milburn lake pty ltd 284924\r\n\r\nHi Shari.\r\n\r\nThought I’d give you the Telstra correspondence so far.\r\nAs an extra note, we also received a written confirmation from Telstra that the maximum line speed for 8 pairs of Ethernet was 4M/4M\r\n\r\nThis was initially purely as an FYI but it does raise a few questions:\r\nI am still waiting for Telstra to respond in writing, but I thought I’d share some of the observations and concerns so far.\r\n\r', 0, 1),
