(3014, 4, 2, 0, 3118, 0, 30, 0, '2012-10-04 17:23:26', 'Further correspondence and information from iiNet.\r\nAfter Comparison, their offering is more expensive over time compared to Exetel, despite seemingly cheaper up-front costs.\r\nUsing ADSL as redundancy to SHDSL is not really a replacement due to lack of upstream speed.\r\nSeemingly expensive hardware.\r\n========================================\r\nHello Charles,\r\n\r\nThank you for your email, please find answers to your questions below.\r\n\r\n1/. Is that 500GB for total data or 500GB of download only?\r\n(rh) 500Gbytes included download\r\n\r\n2/. Is the SHDSL line for a fully protected or unprotected line?\r\n(rh) Service is unprotected.\r\nFor Internet and access redundancy I am recommending primary SHDSL with backup ADSL (and BGP routing) \r\n\r\nThis option will require a Reach ADSL plan with Internet router. \r\n\r\nReach ADSL 5GB: $89.95 per month 24-month (assumes existing PSTN) Internet Router - Cisco 1921-SecK9-ADSL(M) - Internode supplied and configured: $2,800 Router management: $150 per month (includes hardware replacement, support requests with adds/moves/changes and NodeMonitor)\r\n\r\nA protected line has an extra redundant pair (Please refer to attachment) Other Telco''s quote different pricing for the Resiliency Options offered so I just wish this clarified.\r\n\r\n3/. I could not see any Installation fees mentioned.\r\n\r\n(rh) We would need to conduct a detailed feasibility study with a technician dispatched in order to determine additional fees. \r\nThis service is available and has a fee of $2,500 waived if order proceeds.\r\n\r\nIf you have already received a quote for this I would image that fee is inline as it the infrastructure extended from the boundary to the premises.\r\n\r\nAdditional fees would be determined at order stage once the feasibility has been conducted. If you do not wish to proceed with fees service can be cancelled.\r\n\r\nRegards,\r\n\r\n\r\n\r\n \r\n\r\nPaige Downes\r\nBusiness Sales Coordinator \r\n\r\nLevel 1, 502 Hay Street, Subiaco WA 6008\r\nPh: 13 24 49 \r\nFax: 08 9221 8473\r\nEmail: pdownes@staff.iinet.net.au \r\n \r\r\n\r\n\r\n\r\n\r\n\r\n\r\nFrom: Charles Foletta [mailto:charles.foletta@sapient-tech.com.au] \r\nSent: Wednesday, 3 October 2012 11:45 AM\r\nTo: Paige Downes\r\nSubject: RE: iiNet - 144108811\r\n\r\nHello Paige.\r\n\r\nThank you for your response.\r\nA few quick questions:\r\n\r\n1/. Is that 500GB for total data or 500GB of download only?\r\n\r\n2/. Is the SHDSL line for a fully protected or unprotected line?\r\nA protected line has an extra redundant pair (Please refer to attachment)\r\nOther Telco’s quote different pricing for the Resiliency Options offered so I just wish this clarified.\r\n\r\n3/. I could not see any Installation fees mentioned.\r\nOther Telco’s have already quoted installation pricing as an additional cost as a leased line would need to be added from the road to the MDF.\r\nWhat other costs might we expect?\r\n\r\nIf I have any further questions, I’ll let you know.\r\n\r\nRegards.\r\n\r\nCharles. M. Foletta.\r\nSapient Technology Solutions\r\n\r\n(E):  charles.foletta@sapient-tech.com.au\r\n(W): http://www.sapient-tech.com.au/\r\n(B):  61-3-9484-0114   (M):  0413-211-537\r\n\r\nFrom: Paige Downes [mailto:pdownes@staff.westnet.com.au] \r\nSent: Wednesday, 3 October 2012 1:07 PM\r\nTo: Charles Foletta\r\nSubject: iiNet - 144108811\r\n\r\nHello Charles,\r\n \r\nSorry for the delay in getting back to you. \r\n \r\nWe have gained further pricing for SHDSL at this site, and pricing is listed below.\r\n \r\n2Mbps Direct Reach SHDSL (1:1) Service with 500Gbytes of included monthly download\r\nEstablishment: $0\r\nMonthly: $3,350\r\nExcess: $0.01\r\n \r\n4Mbps Direct Reach SHDSL (1:1) Service with 500Gbytes of included monthly download\r\nEstablishment: $0\r\nMonthly: $4,950\r\nExcess: $0.01\r\n \r\nAll pricing is GST-inclusive and based on 24-month term\r\nService is subject to infrastructure availability at time of order and pricing excludes any associated link charges require to deliver service.\r\n \r\nPlease let me know if this pricing is within your budget and how you would like to proceed, alternatively please let me know if you have any further queries.\r\n \r\nRegards,\r\n \r\n \r\n \r\n \r\n\r\nPaige Downes\r\nBusiness Sales Coordinator \r\n\r\nLevel 1, 502 Hay Street, Subiaco WA 6008\r\nPh: 13 24 49 \r\nFax: 08 9221 8473\r\nEmail: pdownes@staff.iinet.net.au \r\n \r\r\n \r\n \r\n \r\n \r\n', 0, 1),
