(3038, 3, 16, 0, 3259, 0, 30, 0, '2012-10-17 14:17:10', 'Heard back from David, didnt seem to be that happy about Eureka Towr guys having access to the eurekatower.com.au domain, claimed that it as still owned by the developers. he did give me access to the domain management and I was able to redelegate the name servers to the bluecentral.com servers ns1.bluecentral.com and ns2.bluecentral.com. Used nslookup to verify that those two servers were able to resolve the eurekatower.com.au domain.', 0, 1),
