(3052, 4, 2, 0, 3285, 0, 30, 0, '2012-10-24 17:55:41', 'Could not print as SHARP printer found to be offline.\r\nDeleted Printer and tried to add Sharp as new Printer.\r\nReceived 0x00000002 error in trying to reconnect.\r\nFound ISF Server based printer to be working.\r\nRestarted Printer Spooler service on IRMIX5 but still received error 0x00000002 when trying to add SHARP as new  printer.\r\nFound IRMIX 5 had not been retarted for around 60 days and had a lot of partially installed update that might interfere with the Print Spooler Service.\r\nAfter restart was able to successfully add SHARP Printer and print successfully.\r\n\r\nExtra: \r\nRemoved old BPOS sign in assistant.\r\nUpdated JAVA to 6/update 37 as reminder appeared..', 0, 1),
(3053, 3, 14, 0, 3286, 0, 11, 0, '2012-10-25 13:38:10', 'Printer Group Policy deployment removed existing printer and attempted to install the new printer. The printer was setup on the server but for some reason has been removed. Had to install the printer and then then re logon to Carmens workstation for printer to be restored. Need to check Why printer was removed from the server.', 0, 1),
(3054, 3, 14, 0, 3284, 3, 0, 0, '2012-10-25 13:38:29', 'Two Machines Installed and tested OK. Needed to backup music from Dianne''s machine and import into the serevr under her profile. Also needed contact the guys from AMP to install COIN onto the 2 workstations. Created Procedure for installation and stored under client information. Additional printer for Johns office may also be required, need to contact jogn for confirmation.', 0, 1),
