(3056, 3, 19, 0, 3287, 2, 0, 0, '2012-10-25 13:46:37', 'Attended Site, Phone point on wall needs to be setup in additional room. Existing phone point goes through a shared wall for the new location. Also need to setup 2 x network points to go from the new room to the old room where the modem/router has been setup.\r\n\r\n1 workstation has a faulty USB network Adapter. The unit is able to join a wireless network but will not pickup a DHCP address from the router. Tried manually setting and using the automated wireless connection methods both failed to setup correctly. Recomended that Dr Jatker replaced with some powerline ethernet adapters or a full PCI-e Wireless network card if they are unabled to be used.\r\n\r\n2nd workstation needs to have spybot go through and clean up the registry and remove older entries. Kicked of a restore from old (18months ago) backup. Process was going to take a few hours so when I reattend with the cabling guys I''ll clean it out then.\r\n\r\nNeed to organise Plexus to come out and add a phone point from the existing line in the wall and add 2 additional nework points that connect to eachother from both rooms. Will need to bring network cables.', 0, 1),
(3057, 3, 14, 0, 3286, 0, 11, 0, '2012-10-25 15:03:35', 'The Administration printer was receiving the SBS user policy, which was replacing the printer with the printer specified in the policy, which removed the shared printer from the server. Solution was to remove the AKP user from the OU which is receiving the printer policy, and place in the default user ou group.', 0, 1),
(3058, 3, 14, 0, 3289, 0, 5, 0, '2012-10-26 14:27:43', 'Set the printer Policy to Create instead of replaced to precent the server from removing it from itself', 0, 1),
(3059, 3, 19, 0, 3287, 2, 0, 0, '2012-10-30 14:13:40', 'Installed Wirless USB Adapter for bedroom PC, all tested OK\r\nSetup the Apple TV to display into the TV and started the iPAD upgrade to be able to use airplay to display content from the Ipad to the TV.\r\nLiased with Tony from Plexus to setup the 4 network points and additional phone points.\r\nAsked to set the Samsung muli function centre to be the main fax device. Unable to complete testing on unit as we ran out of time.', 0, 1),
(3060, 3, 3, 0, 3292, 1, 0, 0, '2012-10-30 16:43:54', 'Server had changed the boot order of the Hard Drives. The serevr can pick only  1 drive to boot from on the RAID arrray and by default it had chosen the data raid not the boot disk. Set the boot disk back to primary boot device. The changes in boot order would have been caused by the server attempting to boot from the USB device. I have disabled booting from all USB devices', 0, 1),
(3061, 3, 3, 0, 3290, 0, 5, 0, '2012-10-30 16:48:18', 'Laptop was using an unkown network based in the 172 range to connect to the internet. Using this network the laptop was unable to sync to the server which requires the outgoing connection to use the 192.168.0.x range. Disabled the network card using the 127 address range and everything now working', 0, 1),
