(3069, 3, 19, 0, 3301, 1, 30, 0, '2012-11-02 10:53:03', 'Found the fax line disconnected at the wall socket. Plugged in the multifunction centre and sent a test fax through to Charles in the office. Charles received the fax and sucessfully sent a fax back to the mulit function centre. Fax is working ok. The apple TV needed an upgrade to be applied and once applied we streamed conent from the iPad to the apple tv. The iPad needed the apple account for itunes to be resetup. When playing back content from the iPad onto the TV the following error was recevied. HDMI cable doesn''t support HDCP please replace the cable. restarted all of the devices (TV and apple TV) and reseated each plug, but problem was not resolved. Ill need to get a higher qualitity HDMI cable to resolve this issue.', 0, 1),
(3070, 3, 3, 0, 3303, 0, 45, 0, '2012-11-03 11:07:10', 'Server C:\\Drive was full and the transport hub switched off receiving external emails. Removed excess log files from the inetpub directory to bring the free space on drive c to 14Gb from 4 Gb. Also kicked off a WSUS cleanup wizrd to remove unused updates from the C Drive. Tested using telnet that the insufficent resource error was no longer appearing and preventing external emails from being received.', 0, 1),
