(3080, 4, 2, 0, 3118, 0, 45, 0, '2012-11-13 14:56:31', 'Further Correspondence with Telstra.\r\nThe goal posts are being moved around a lot here by Telstra and I am constantly having to chase them.\r\nTelstra really do not seem interested.\r\n\r\nFrom: Sancheti, Deep [mailto:Deepesh.Sancheti@team.telstra.com] \r\nSent: Friday, 26 October 2012 2:29 PM\r\nTo: Gabriel, Rob\r\nCc: Charles Foletta\r\nSubject: RE: (LJ) milburn lake pty ltd 284924\r\n\r\nHi Rob,\r\n\r\nPlease let me know the progress of it\r\n\r\nCharles, do you know their budget as Telstra may require 2.5 KM of trenching\r\n\r\nThank you \r\n\r\n     \r\n\r\nDeepesh Sancheti\r\nAccount Executive\r\n13 / 242 Exhibition st Melbourne Vic 3000\r\nT: 03 8647 3128 | M: 0439 415 388\r\n| E:  deepesh.sancheti@team.telstra.com | F: 03 8601 8003 \r\nFor Faults: T: 132999 \r\nFor Billing or Service Activations: T: 132253 \r\nTo ensure you receive the best customer service my Sales Manager Bill Asimakidis can also be contacted on T: 03 8647 3145| E: Bill.Asimakidis1@team.telstra.com\r\n_____________________________ \r\nSubscribe to Telstra Business and receive updates on Telstra Products, Services, and Special Offers \r\nwww.telstrabusiness.com/subscribe \r\nTELSTRA PRIVILEGED - PRIVATE AND CONFIDENTIAL \r\nThe information contained in this e-mail is confidential. It is only intended for the recipient/s named above. If you are not the intended or one of the intended recipient/s any unauthorised use is prohibited.\r\nIf you have received this e-mail in error, please notify the sender so that arrangements can be made for its retrieval or destruction. Confidentiality and legal privilege are not waived or lost as a result of mistaken delivery.  Telstra Corporation Limited ACN 051 775 556\r\n\r\nFrom: Charles Foletta [mailto:charles.foletta@sapient-tech.com.au] \r\nSent: Wednesday, 24 October 2012 1:29 PM\r\nTo: Gabriel, Rob\r\nCc: Sancheti, Deep\r\nSubject: FW: (LJ) milburn lake pty ltd 284924\r\n\r\nHi Rob.\r\n\r\nAs  per our discussion with Deepesh today.\r\nThe feasibility report for Fibre should arrive around next Tuesday 30th October.\r\n\r\nHe asked me to re email you as a courtesy and a reminder.\r\nTo confirm from the client that there is still an expression of preference of taking fibre over any copper solution and its inherent limitations.\r\nIt all depends upon overall cost  and any additional costs including trenching the 2.5-3km run.\r\nWe would definitely like a projection of timeline for any required works so that it fits in with construction of the factory on site.\r\n\r\nRegards.\r\n\r\nCharles. M. Foletta.\r\nSapient Technology Solutions\r\n\r\n(E):  charles.foletta@sapient-tech.com.au\r\n(W): http://www.sapient-tech.com.au/\r\n(B):  61-3-9484-0114   (M):  0413-211-537\r\n\r\nFrom: Charles Foletta \r\nSent: Wednesday, 17 October 2012 2:54 PM\r\nTo: ''Robert.Gabriel@team.telstra.com''\r\nSubject: FW: (LJ) milburn lake pty ltd 284924\r\n\r\nHi Rob.\r\n\r\nDetails of Client is as follows:\r\n\r\nMilburn Lake\r\n5205 South Gippsland Hwy.\r\nLang Lang\r\nVictoria 3984\r\n\r\nExtra notes:\r\nThey do have an existing DSL2 line:\r\nUsername: Milbur0@direct.telstra.net \r\nThe service is on the fax line 03 5997 5096\r\nWas told by Telstra that current line speed is at @ 8MBps when service went down a few months ago.\r\n\r\nClient is building factory on site and have cloud based applications (CRM, Office 365 etc.)\r\nClient requires higher than normal upstream speeds, so a synchronous connection will be required.\r\nConcerned that Copper technologies are near limited with ~4650m cable run from exchange.\r\nTelstra Pakenham is only offering a 4Mbps/4Mbps Ethernet service which is at the upper limit of the technology and may not ultimately be enough for machinery and staff.\r\n\r\nFor any expansion, client would benefit from a fibre service.\r\nAware that fibre runs within 550m of premises.\r\n\r\nRegards\r\n\r\nCharles. M. Foletta.\r\nSapient Technology Solutions\r\n\r\n(E):  charles.foletta@sapient-tech.com.au\r\n(W): http://www.sapient-tech.com.au/\r\n(B):  61-3-9484-0114   (M):  0413-211-537\r\n\r\nFrom: Sancheti, Deep [mailto:Deepesh.Sancheti@team.telstra.com] \r\nSent: Wednesday, 10 October 2012 2:15 PM\r\nTo: Charles Foletta; Gabriel, Rob\r\nSubject: RE: (LJ) milburn lake pty ltd 284924\r\n\r\nHi Charles\r\n\r\nRob and I are working on it and update you accordingly \r\n\r\nRob’s contact number is 0459835725\r\n\r\nThank you \r\n\r\n     \r\n\r\nDeepesh Sancheti\r\nAccount Executive\r\n13 / 242 Exhibition st Melbourne Vic 3000\r\nT: 03 8647 3128 | M: 0439 415 388\r\n| E:  deepesh.sancheti@team.telstra.com | F: 03 8601 8003 \r\nFor Faults: T: 132999 \r\nFor Billing or Service Activations: T: 132253 \r\nTo ensure you receive the best customer service my Sales Manager Bill Asimakidis can also be contacted on T: 03 8647 3145| E: Bill.Asimakidis1@team.telstra.com\r\n_____________________________ \r\nSubscribe to Telstra Business and receive updates on Telstra Products, Services, and Special Offers \r\nwww.telstrabusiness.com/subscribe \r\nTELSTRA PRIVILEGED - PRIVATE AND CONFIDENTIAL \r\nThe information contained in this e-mail is confidential. It is only intended for the recipient/s named above. If you are not the intended or one of the intended recipien', 0, 1),
(3081, 4, 2, 0, 3118, 0, 15, 0, '2012-11-13 15:03:59', 'After further  delays by Telstra and chasing them, the Goal Posts have been moved again.\r\nTrenching required is now some 50km to the fibre enabled exchange at Warrigul.\r\nI had to show evidence of company size to get Telstra to move foward to even get to suggest a figure.\r\n\r\nFrom: Gabriel, Rob [mailto:Robert.Gabriel@team.telstra.com] \r\nSent: Wednesday, 7 November 2012 10:50 PM\r\nTo: Charles Foletta\r\nCc: Sancheti, Deep\r\nSubject: RE: Milburn Lake Pty Ltd\r\n\r\nHi Charles,\r\n\r\nThanks for the email.\r\nIt seems that the nearest exchange to haul fibre from is:\r\n33 PALMERSTON ST WARRAGUL 3820 { Telstra Exchange} , \r\nI will have a report very shortly in terms of costs and time frame etc.\r\n\r\nCheers\r\n\r\n \r\n\r\nRob Gabriel  \r\nTechnology Solution Specialist\r\nSolution Sales \r\nTelstra Business \r\nLevel 13 / 242 Exhibition Street Melbourne Vic 3000 \r\n03-8649-6321  |   Mobile: 0459-835-725   |  Robert.Gabriel@team.telstra.com |   W  www.telstrabusiness.com\r\n\r\n \r\nThis communication may contain confidential or copyright information of Telstra Corporation Limited (ABN 33 051 775 556). \r\nIf you are not an intended recipient, you must not keep, forward, copy, use, save or rely on this communication, and any such \r\naction is unauthorised and prohibited. If you have received this communication in error, please reply to this email to notify the \r\nsender of its incorrect delivery, and then delete both it and your reply.\r\n \r\n  \r\n\r\n    Connect IP\r\n\r\nFrom: Charles Foletta \r\nSent: Wednesday, 7 November 2012 6:03 PM\r\nTo: Robert.Gabriel@team.telstra.com\r\nSubject: Milburn Lake Pty Ltd\r\n\r\nHi Rob.\r\n\r\nAs requested per our previous conversation, they were easy to find on ASIC.\r\nParts of their company runs through their ABN and parts through their business name.\r\nI had a check at their staffing levels and they do seem to currently have 25-30 staff.\r\nI was not aware they had that many staff since so many were in the field.\r\n\r\nIn any case where possible, the last thing we want to do is to “pidgeon-hole” our client to try to use copper products where current or even future demand cannot be met by a service that cannot be upgraded.\r\nWith cloud based applications being used by this company, a reliable upstream speed will be required.\r\n\r\nRegards\r\n\r\nCharles. M. Foletta.\r\nSapient Technology Solutions\r\n\r\n(E):  charles.foletta@sapient-tech.com.au\r\n(W): http://www.sapient-tech.com.au/\r\n(B):  61-3-9484-0114   (M):  0413-211-537\r\n\r\n', 0, 1),
(3082, 4, 2, 0, 3118, 0, 30, 0, '2012-11-13 15:12:23', 'Irwins Project Manager wants an answer.\r\n\r\nTelstra once again making excuses and moving goal posts again:\r\nAfter 10 weeks they come back and say they can''ts give me an estimate for legal reasons and that Irwins would need to present $10,000.00 to have a survey to get an accurate quote. \r\nThe escalation in cost is getting ridiculous for a simple answer so a little "horse trading" ensued to get some sort of written feedback and approximate estimation without any liability to Telstra..\r\n\r\nFrom: Sancheti, Deep [mailto:Deepesh.Sancheti@team.telstra.com] \r\nSent: Monday, 12 November 2012 1:40 PM\r\nTo: Charles Foletta\r\nCc: Asimakidis, Bill; Gabriel, Rob; Hunt, Alastair\r\nSubject: RE: [WideFeas] Feasibility Submitted: S8254 for Milburn Lake\r\nImportance: High\r\n\r\nHi Charles,\r\n\r\nApology for delay to provide you the figures as it occurred  due to infrastructure issues.\r\n\r\nPlease be advised that Telstra requires 10K to further study to provide a accurate quote.\r\n\r\nAt the moment the cost is looking between $130K  to $250 K \r\n\r\nPlease confirm should  Milburn Lake commit to spend $10K for further study to provide accurate quote.\r\n\r\nI look forward for your email \r\n\r\nThank you \r\n\r\n     \r\n\r\nDeepesh Sancheti\r\nAccount Executive\r\n13 / 242 Exhibition st Melbourne Vic 3000\r\nT: 03 8647 3128 | M: 0439 415 388\r\n| E:  deepesh.sancheti@team.telstra.com | F: 03 8601 8003 \r\nFor Faults: T: 132999 \r\nFor Billing or Service Activations: T: 132253 \r\nTo ensure you receive the best customer service my Sales Manager Bill Asimakidis can also be contacted on T: 03 8647 3145| E: Bill.Asimakidis1@team.telstra.com\r\n_____________________________ \r\nSubscribe to Telstra Business and receive updates on Telstra Products, Services, and Special Offers \r\nwww.telstrabusiness.com/subscribe \r\nTELSTRA PRIVILEGED - PRIVATE AND CONFIDENTIAL \r\nThe information contained in this e-mail is confidential. It is only intended for the recipient/s named above. If you are not the intended or one of the intended recipient/s any unauthorised use is prohibited.\r\nIf you have received this e-mail in error, please notify the sender so that arrangements can be made for its retrieval or destruction. Confidentiality and legal privilege are not waived or lost as a result of mistaken delivery.  Telstra Corporation Limited ACN 051 775 556\r\n\r\n*\r\n', 0, 1),
