(3097, 4, 25, 0, 3336, 0, 45, 0, '2012-11-22 17:40:26', 'IE constanly redirecting to other sales websites.\r\nMSE Anti-Virus constantly closing after a few seconds an not usable,\r\nSpybot S&D  found nothing & later uninstalled.\r\n\r\nGascon8 PC (W7) started in safe mode.\r\nRan Kaspersky AVPtool,  found nothing.\r\nMSCONFIG suspect entries in Startup TAB.\r\nThes entries were disabled. \r\n\r\nAfter numerous normal restarts\r\nMSE successfully ran and updated. \r\nFull scan was run with no detections found. \r\nIE could now run without issue. .\r\n\r\nNote: \r\nFiles found in folder \\\\Users\\Gascon8\\appdata\\roaming\\\r\nBoth files were 84k with random DLL name which were being registered in the startup TAB.\r\nNo company version infomation in file properties.\r\nTook control of files and deleted.\r\nEntries were not in HKLM or HKCU, but could be part of the GASCON8 local service. Should not be necessary to remove.\r\nthese.\r\n\r\n\r\n\r\n\r\n', 0, 1),
(3098, 4, 9, 0, 3338, 0, 30, 0, '2012-11-23 10:31:23', 'Checked on Labtech to confirm other machines at Edgard were connected and found that only Simons machine (WS031) had issue.\r\nWith Simons help, I was able to determine that there was no connection to LAN via the Ethernet cable (no LED).\r\nSimons machine is connected via one ethernet cable to a mini data swtch. Then via another ethernet cable to the main data switch. \r\nThe mini switch was on and functioning.\r\nHe found one of the cables to be tight and strained and loosening the tight cables and reconnecting them resulted in being able to reconnect to the LAN (LEDs now visible).\r\nSimon logged back on with all network drives, IE, and email accessible.\r\n\r\n', 0, 1),
