(3170, 4, 2, 0, 3418, 0, 0, 0, '2012-12-27 11:30:59', 'Server beeing.\r\nKeyboard not working properly (Keyboard sticking on enter key).\r\nDust cleared to work.\r\nArray said to be broken in BIOS.\r\nFound RAID controller to be Highpoint 181x/182x controller.\r\nDownloaded and installed Highpoint RAID controller management software v3.09 to suit controller.\r\nArray size should be 1GB (930GB).\r\nFound RAID 5 array to be broken with only the two Samsung 500GB drives in an array. \r\nFound seperate array with single 500GB Seagate drive, which has likely failed.\r\nNo noticilbe data loss.\r\nAdvised Madeleine.\r\nOrganised backup, replacement of faulty drive and rebuild of array for Saturday 29th @~8AM.\r\n\r\n\r\n', 0, 1),
(3171, 4, 2, 0, 3418, 1, 45, 0, '2012-12-29 09:58:31', 'Arrived on site.\r\nLogged on to server.\r\nWhile waiting for server to log me in, I looked at Madeleines request to look at  Davids PC as one of David''s monitors was not working.\r\nFound both monitors to be working and that the input for one of them to be set to HDMI rather than DVI as per the connection.\r\nLogged out all workstations on site and shut them down.\r\nFound server had still not fully logged in and in fact had crashed.\r\nOnly a Blue desktop background (NOT BSOD) and no icons.\r\nCould not access task manager.\r\nCould not access remotely via RDP or via Labtech VNC to recover server. Labtech had lost contact with Server.\r\nForced to re-boot server with restart.\r\nServer re booted an could log in properly.\r\nUsed NT backup with verify to take a full backup of drive D (RAID) to USB drive I provided.\r\nProcess would take ~4.5 hours plus a further 1.5 hours to verify the backup before I could proceed.\r\nDecided to leave to save client labour and allow cleaning staff to lock up. will return later in the evening.\r\n', 0, 1),
(3172, 4, 2, 0, 3418, 2, 15, 0, '2012-12-29 10:25:12', 'Monitored Backup and verify via Labtech VNC.\r\nETA of completed backup @ 17:05.\r\nArrived on site at 17:15.\r\nChecked report of backup/verify andfound to be good.\r\nSaved copy with backup.\r\nShut down server and identify/replace HD in RAID array without issue.\r\nRestart of server without issue.\r\nAdded RAID service manager as startup item (It is an Application even though it is called a service).\r\nBegan online rebuild of RAID array and begun lockup procedure as per Madeleine request.@4% rebuild complete when I left. Expect completion of rebuild around Midnight.\r\nLights switched off as requested.\r\nKey back under mat.\r\nKicked and held keypad door, confirmed I cannot re-open it.\r\nConfirmed remote access to ISFSERVER-MELB via VNC from Labtech mobile Application.\r\nReported to Madeline remotely via SMS to confirm client satisfaction.\r\nRebuild confirmed as completed at 11:50PM.', 0, 1),
(3173, 4, 2, 0, 3418, 0, 0, 0, '2013-01-01 10:47:39', 'Travel has up to now not been included. This is a cost that should be billed.\r\nIt is less than the actual time but I am adding ~45 min per visit. Especially the 2 trips on the weekend, and being onsite @ 7:30AM on the Thursday (Got messaged at ~6:15AM).\r\nMuch shorter than usual as roads are quiet being holiday season.\r\n\r\nRemote monitoring of progress of works not being added for client''s benefit.\r\n\r\nWD blue drive picked up at CPL. Look for Invoice dated 2012-12-27.\r\nHardware cost needs to be added to IMP.\r\n', 0, 1),
