(3205, 4, 6, 0, 3479, 3, 0, 0, '2013-01-17 14:14:21', 'PC screen actually dark and unable to tell if PC was booting up.\r\nWas able to see PC logon in 640*480 mode(mode with network functioning).\r\nConfirmed domain had changed from dca to vic,dca.\r\nReceived message "The system is unable to authenticate this user, please verify the user credentials and host information before continuing." when trying to log in as Administrator.\r\nMachine currently identifying itelf as dca-28ms5atcf.\r\nCredentials to connect to domain seem corrupt.\r\nHad to generate Local Administrator to access machine.\r\nReset Administrator and Admin users passwords for this single machine. \r\nPassword was set to s@p13nt3072 for both accounts.\r\nAble to log in as local administrator and update credentials. PC was now identifying itelf as dca-28. \r\nVideo driver corrupt and updated to NVIDIA v310. LHS LED monitor works but RHS LED monitor (SAMSUNG) not working. Found  to be set on digital (DVI) input not analogue (DB9). Changing input did not resolve issue. Had to assume monitor was damaged. Getiing replacement monitor from server room did not fully resolve as CHIMEI monitor would lose picture after ~25 seconds. BENQ monitor from second Reception PC worked fine when tested for 10+ minutes. No other spare monitors seem to be available.\r\nFrankie able to properly log in as user "melb.reception". Confirmed he had fuill access to his resources. Decided that for short term Frankie can work off a single monitor until David returns rather than lose one of the reception PC''s so that another can still have 2 monitors.\r\nAdvised Geoff Manton (manager) of status before leaving site. Issue resolved.\r\n\r\n', 0, 1),
(3206, 3, 25, 0, 3490, 1, 0, 0, '2013-01-22 14:15:09', 'Changed the Printer IP to  192.168.0.17, sucessfully printed one document then the printer went offline and I as unable to print from any workstation. Finally had to hard reset the printer to affect the changes properly. Setup a local printer on each workstation instead of going through GASCON-4. Printer system password is the default sysadm', 0, 1),
