(3212, 3, 12, 0, 3492, 2, 0, 0, '2013-01-25 15:23:34', 'removed the exploit fromthe system. The following exploits were found on the system. index.php renamed and refering all access through a 3rd party site. Also index.old.php added to every directory in the website. Patched and fixed the jdownload plugin to fix the entry point for the exploit.', 0, 1),
(3213, 3, 2, 0, 3500, 0, 20, 0, '2013-01-30 07:49:41', 'Its a permissions issues with the way that XR elements set the system up. You need to increase the user''s access to a manager level security role and then you can sign in. here is how I did it for future ref\r\n\r\n \r\n\r\nsign in to CRM as Madeliene\r\nclick on settings (bottom LHS)\r\nClick on "Administration" Left menu "system" section\r\nClick on Uesrs (main window)\r\nSelect User and click\r\nclick ''Security Roles" from Left Menu\r\nClick "manage  roles" and then tick a manager role - This normally allows them to connect into the system via outlook\r\n\r\n', 0, 1),
(3214, 4, 2, 0, 3500, 4, 30, 0, '2013-01-29 09:30:09', 'After reinstall and registry check of "Bitness" key as per Microsoft article \r\nCRM.\r\nSays \r\n"Cannot configure the organisation for Microsoft Dynamics CRM for Outlook."\r\nAlso says\r\n"You do not have permission to access these records. Contact your Microsoft Dynamics CRM administrator."\r\nLogs suggest  Principle User missing privReadRole privledge (ID=long string ).\r\nUsed troubleshooting wizard and checked security role via user CRMadmin and found to be set up in same way to user Mal Rogers and "User Entity UI Setting" seem ok.\r\n\r\n', 0, 1),
(3215, 3, 2, 0, 3504, 0, 10, 0, '2013-01-30 13:16:12', 'Laptop connected through to server', 0, 1),
(3216, 4, 2, 0, 3501, 2, 20, 0, '2013-01-30 13:30:13', 'Mal''s machine had similar issues to Shanes.\r\n\r\nRemedy:\r\n\r\n1/. Uninstall CRM installation broken by rollup 12 or other circumstance.\r\n2/. Clear Legacy registry entries using CCleaner. \r\nIf required refer to KB 2500375 if wrong size application is previously run (32 bit version must be run on a 32 bit office application even in a 64 bit OS)\r\n3/. Download and run CRM online install tool (it chooses the version of CRM required and provides necessary updates).\r\nMake sure you instaii in "Custom" and tick offline mode.\r\nWhile tool is running, check and (if required) update security roles for user (Log on as CRMadmin or similar administrator class). \r\n3a/. Log On\r\n3b/. Setting\r\n3c/. Administration\r\n3d/. Users\r\nChoose User to update\r\n(In "Reated area on LHS of screen that appears for said user)\r\n3e/. Select "Security Roles" under "Common" arrow. \r\nyou will see a "Role associated View" window\r\n3f/. Add required role that is in keeping with staff member choosing managing roles.\r\n(We used Marketing Manager in current case)\r\nDo not use admnistrator.\r\n4/. Restart after installation and open diagnostics. Tick Background send email.\r\n5/. Open Outlook.Make sure 1 (Office 2007) or both (Office 2010 has 2 plug-ins (Add-ons))  Add-ons are ticked.\r\n6/. While in Outlook, you will be requested to syn up to CRM.\r\nYou will need:\r\n6a/. URL\r\n6b/. Username\r\n6c/. Password\r\nThis should sync & complete configuration of Organisation.\r\nOutlook may ask to send some email for some orders previously made while CRM wasn''t working.\r\n\r\nWrote up report and procedure.\r\n\r\nMal called ~ 14:00 to confirm CRM working  and I waited for order to process.\r\n\r\n', 0, 1),
(3217, 4, 2, 0, 3505, 2, 8, 0, '2013-01-30 15:40:51', 'Spoke to Robyn. She felt there was no issue with her PC regarding speed of outlook and that Shamus was looking at other CRM based issues for her.\r\nTrevors CRM was not working either.\r\n\r\nRemedy:\r\n\r\n1/. Uninstall CRM installation broken by rollup 12 or other circumstance.\r\n2/. Clear Legacy registry entries using CCleaner. \r\nIf required refer to KB 2500375 if wrong size application is previously run (32 bit version must be run on a 32 bit office application even in a 64 bit OS)\r\n3/. Download and run CRM online install tool (it chooses the version of CRM required and provides necessary updates).\r\nMake sure you instaii in "Custom" and tick offline mode.\r\nWhile tool is running, check and (if required) update security roles for user (Log on as CRMadmin or similar administrator class). \r\n3a/. Log On\r\n3b/. Setting\r\n3c/. Administration\r\n3d/. Users\r\nChoose User to update\r\n(In "Reated area on LHS of screen that appears for said user)\r\n3e/. Select "Security Roles" under "Common" arrow. \r\nyou will see a "Role associated View" window\r\n3f/. Add required role that is in keeping with staff member choosing managing roles.\r\n(We used Marketing Manager in current case)\r\nDo not use admnistrator.\r\n4/. Restart after installation and open diagnostics. Tick Background send email.\r\n5/. Open Outlook.Make sure 1 (Office 2007) or both (Office 2010 has 2 plug-ins (Add-ons))  Add-ons are ticked.\r\n6/. While in Outlook, you will be requested to syn up to CRM.\r\nYou will need:\r\n6a/. URL\r\n6b/. Username\r\n6c/. Password\r\nThis should sync & complete configuration of Organisation.\r\nIt did NOT sync and had to add "Marketing Manager" Security Role as described in section 3/a to 3/f.\r\nWas then able to sync.\r\n\r\nTrevor also asked auto complete infomation be repaired.\r\n\r\nRemedy as follows:\r\nMicrosoft Exchange Server accounts\r\n 1.Prepare Outlook to run without Cached Exchange Mode.\r\n1.Click the File tab, and then click Account Settings.\r\n2.Click Account Settings.\r\n3.Click your Microsoft Exchange Server account, and then click Change.\r\n4.Clear the Use Cached Exchange Mode check box, click Next, and then click Finish.\r\n5.On the Account Settings dialog box, click Close.\r\n2.Exit Outlook.\r\n3.Open the %LOCALAPPDATA%\\Microsoft\\Outlook folder.\r\n Click Start, and then enter %LOCALAPPDATA%\\Microsoft\\Outlook in the Search program and files or Start Search box. You can also copy and paste the location into Windows Explorer address bar.\r\n 4.Right-click the RoamCache folder, click Rename, and change the folder name to old_RoamCache.\r\n5.Start Outlook.\r\n6.Turn on Cached Exchange Mode.\r\n1.Click the File tab, and then click Account Settings.\r\n2.Click Account Settings.\r\n3.Click your Microsoft Exchange Server account, and then click Change.\r\n4.Select the Use Cached Exchange Mode check box, click Next, and then click Finish.\r\n5.On the Account Settings dialog box, click Close.\r\n7.Exit and then restart Outlook.\r\n\r\nIssues Resolved.\r\n\r\nOutlook much faster and Autocomplete Info working for Trevor.\r\nMay have to look at Robyn again later.\r\n', 0, 1),
