(3225, 4, 2, 0, 3519, 2, 15, 0, '2013-02-04 16:19:37', '← Server beeping.\r\nKeyboard not working properly (Keyboard sticking on enter key).\r\nDust cleared to work.\r\nArray said to be broken in BIOS.\r\nFound RAID controller to be Highpoint 181x/182x controller.\r\nDownloaded and installed Highpoint RAID controller management software v3.09 to suit controller.\r\nArray size should be 1GB (930GB).\r\nFound RAID 5 array to be broken with only the two Samsung 500GB drives in an array.\r\nFound seperate array with single 500GB Seagate drive, which has likely failed.\r\nNo noticilbe data loss.\r\nAdvised Madeleine.\r\nOrganised backup, replacement of faulty drive and rebuild of array for Saturday 29th @8AM\r\n \r\n  \r\n  \r\nComment Added by charles on 27/12/2012 11:56:46 AM \r\n← 2* 500GB Samsung Drives form a 1GB drive. \r\n  \r\n  \r\nComment Added by charles on 27/12/2012 11:59:14 AM \r\n← CPL Invoice D1247186 $55.63ex $61.20inc \r\n  \r\n  \r\n', 0, 1),
