(4054, 4, 15, 0, 5051, 1, 0, 0, '2013-09-16 13:01:57', 'Confirmed cannot Print.\r\nRemoved existing printer drivers.\r\nNo XP drivers in support$ so downloaded XP drivers from Brother Website.\r\nDeleting and reinstalling Printer Drivers does not work.\r\nUsed BRN001BA9202FAB as current pinter name of Port and did not work\r\nCannot ping 192.168.1.33\r\nPinged Printer nameBRN001BA9202FAB to resolve current IP address 192.168.1.52.\r\nAccessed Web Server on Brother MFC at address 192.168.1.52.\r\nFound Printer was DHCP on boot and XP based printer drivers could not update IP Address based upon printer port name like Windows 7 drivers can.\r\nFixed Printer IP to 192.168.1.33 as before (not 192.168.1.52). \r\nSet boot mode of printer to static rather than auto. \r\nLaura''s XP machine and Windows 7  machine can print properly now.\r\n', 0, 1),
