(4178, 4, 34, 0, 5231, 0, 15, 0, '2013-10-18 12:54:43', 'Set up username and Folder on server.\r\nNeed admin access to printer and will need to reset NVM.\r\nWe need the default Fuji Xerox Password to set up the SCANS folder on the server in P drive as a scan to location.\r\nPassword for username “scans” is in Labtech.\r\n\r\nResetting to Factory Defaults\r\n--------------------------------------------------------------------------------\r\nAfter executing Initialize NVM and rebooting the printer, all the menu parameters or data are reset to their default values. \r\n\r\n1     Press the System button. \r\n 2     Select Admin Menu, and then press the  button. \r\n 3     Select Maintenance, and then press the  button. \r\n 4     Select Initialize NVM, and then press the  button. \r\n 5     Select the desired setting, and then press the  button. \r\n 6     Select Yes, and then press the  button. \r\n \r\nThe printer restarts automatically to apply the settings.\r\n', 0, 1),
