(4308, 4, 37, 0, 5530, 0, 30, 0, '2014-02-06 13:59:58', 'Windows PoP-Up window constantly re-ppears.\r\nCan re-connect without offering credentials, but Windows Secuity PoP-Up will reappear ~90 seconds later.\r\nNew profile does not resolve issue.\r\nIssue appears to be server related.\r\n\r\nApplied Following:\r\nIn IIS, navigate to “EWS” web site, right-click, select “Properties”.  Select the “Directory Security” tab.  In the “Secure Communications” frame, click “Edit”.  On the "Secure Communications" dialog, tick the “Require secure channel (SSL)” box and in the “Client Certificates” frame, select “Ignore client certificates”.  Click "OK", click "Apply".\r\n\r\nRestart autodiscover webpage.\r\n\r\nAnnoying windows have not resurfaced for over 15 minutes (Normally 30-90 seconds).\r\n\r\nNicol will advise is issue has not been resolved.', 0, 1),
