(4340, 4, 27, 0, 5592, 0, 30, 0, '2014-02-27 12:57:12', 'Unable to connect to server, no response.\r\nServer indicates it is running at 100% CPU.\r\nInvestigation of process found Explorere.exe running at 100%\r\nKill Explorer.exe process.\r\nNow able to connect to server. Re initialise Explorer.exe process with process now running at ~0%.\r\nContacted Liz Tierney to check system and network performance.\r\nLiz confirms vast improvement in performance. \r\nLiz asks that I look at missing files/3CP folder issue with Coralees Home Drive. Issue resolved with files visable and cause seems to be due to Coralee unable to properly connect toserver due to Explorer.exe using all available CPU cycles on server.\r\n\r\n\r\n', 0, 1),
