(4343, 3, 34, 0, 5595, 3, 0, 0, '2014-02-27 09:20:08', 'Found server stuck in recovery mode. Server is unable to boot, turned off the automatic restart and found that on booting the server was BSOD and returning an error abut unable to mount the active directory database. Booted server in directory services recovery mode, booted successfully. Performed a database recovery using esenutl /p. Server now working correctly. Fixed the UPS software setup to send out email notifications to support@sapient-tech.com.au on any power events. tested UPS working by simulating a power shutdown, all working correctly.', 0, 1),
(4344, 3, 34, 0, 5595, 2, 30, 0, '2014-02-28 09:22:21', 'Attended site, found the network switch was not working correctly. restarted switch and everything now working. BUT, found an issue with the database repair for AD, the server name now comes up as SERVER NOT ALDSVR1 in a lot of services and netlogon service is not working. Did some digging and found that repairing the AD database is a lossy recovery and some of the database will be deleted. Microsoft recomend that after esenutl is used the entire server is rebuilt from scratch.....\r\n\r\nTalked to Alfie and scheduled a rough time wednesday next week at 4pm to rebuild the server.', 0, 1),
